import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Address = () => {
  const [address, setAddress] = useState({
    street: "",
    city: "",
    state: "",
    postal_code: "",
    country: "",
  });
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setAddress((prevAddress) => ({
      ...prevAddress,
      [name]: value,
    }));
  };

  const handleAddressSubmit = async (e) => {
    e.preventDefault();

    try {
      const userId = sessionStorage.getItem("user_id");
      if (!userId) {
        alert("Please log in to add your address.");
        navigate("/login");
        return;
      }

      // Make API call to save the address
      const response = await axios.post("http://localhost:8000/medical_store_app/add_address/", {
        user_id: userId,
        ...address, // Send the individual fields for the address
      });

      if (response.status === 200) {
        alert("Address saved successfully!");
        navigate("/checkout");
      } else {
        alert("Failed to save the address. Please try again.");
      }
    } catch (error) {
      console.error("Error saving address:", error);
      alert("An error occurred while saving your address.");
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Add or Update Billing Address</h1>
      <form style={styles.form} onSubmit={handleAddressSubmit}>
        <label style={styles.label}>
          Street:
          <input
            type="text"
            name="street"
            value={address.street}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Enter your street address"
            required
          />
        </label>
        <label style={styles.label}>
          phone no
          <input
            type="text"
            name="phone_no"
            value={address.street}
            onChange={handleInputChange}
            style={styles.input}
            pattern="[6789][0-9]{9}" title="Please enter valid phone number"
            required
          />
        </label>
        <label style={styles.label}>
          City:
          <input
            type="text"
            name="city"
            value={address.city}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Enter your city"
            required
          />
        </label>
        <label style={styles.label}>
          State:
          <input
            type="text"
            name="state"
            value={address.state}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Enter your state"
            required
          />
        </label>
        <label style={styles.label}>
          Postal Code:
          <input
            type="text"
            name="postal_code"
            value={address.postal_code}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Enter your postal code"
            required
          />
        </label>
        <label style={styles.label}>
          Country:
          <input
            type="text"
            name="country"
            value={address.country}
            onChange={handleInputChange}
            style={styles.input}
            placeholder="Enter your country"
            required
          />
        </label>
        <button style={styles.button} type="submit">
          Save Address
        </button>
      </form>
    </div>
  );
};

const styles = {
  container: {
    padding: "40px",
    fontFamily: "Arial, sans-serif",
    textAlign: "center",
  },
  heading: {
    fontSize: "2rem",
    marginBottom: "20px",
  },
  form: {
    maxWidth: "500px",
    margin: "0 auto",
    textAlign: "left",
  },
  label: {
    display: "block",
    marginBottom: "10px",
    fontWeight: "bold",
  },
  input: {
    width: "100%",
    padding: "10px",
    border: "1px solid #ccc",
    borderRadius: "5px",
    marginBottom: "15px",
    fontSize: "1rem",
  },
  button: {
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    padding: "10px 20px",
    fontSize: "1rem",
    borderRadius: "5px",
    cursor: "pointer",
    marginTop: "20px",
  },
};

export default Address;
